import { useDispatch, useSelector } from 'react-redux';
import { select } from '@reducers/category-reducer';

function App() {
  const dispatch = useDispatch();
  const selected = useSelector(state => state.category.selected);

  return (
    <>
      <button onClick={() => dispatch(select(Math.random()))}>Click here to increment</button>
      <p>Selected: {selected}</p>
    </>
  );
}

export default App;
